[[package]]
name = "zeam-scheduler"
version = "0.1.0"
source = { editable = "components/zeam/scheduler" }
dependencies = [
    { name = "celery", extra = ["redis"] },
    { name = "flower" },
    { name = "pandas" },
    { name = "python-json-logger" },
    { name = "zeam-popularity" },
    { name = "zeam-redis" },
    { name = "zeam-redshift" },
]

[package.dev-dependencies]
test = [
    { name = "pytest" },
]

[package.metadata]
requires-dist = [
    { name = "celery", specifier = ">=5.3.6" },
    { name = "celery", extras = ["redis"], specifier = ">=5.4.0" },
    { name = "flower", specifier = ">=2.0.1" },
    { name = "pandas", specifier = ">=2.1.4" },
    { name = "python-json-logger", specifier = ">=2.0.7" },
    { name = "zeam-popularity", editable = "components/zeam/popularity" },
    { name = "zeam-redis", editable = "components/zeam/redis" },
    { name = "zeam-redshift", editable = "components/zeam/redshift" },
]

[package.metadata.requires-dev]
test = [{ name = "pytest", specifier = ">=8.0.0" }]

[[package]]
name = "zeam-worker"
